sys_variable_value.value:
(function execute(inputs, outputs) {

  outputs.api_endpoint = inputs.connection_url;
  if (outputs.api_endpoint == 'https://api.github.com') {
    outputs.frontend_url = 'https://github.com';
  } else {
    const result = outputs.api_endpoint.match(/^(https?:\/\/[^/]+)/);
    if (result && result.length > 1) {
      outputs.frontend_url = result[1];
    }
  }

})(inputs, outputs);

